<style>
  *, *:before, *:after {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

html, body {
  width: 100%;
  height: 100%;
}

body {
  background-color: #e6e6e6;
}

.wrap {
  position: relative;
  padding-top: 10%;
  overflow: hidden;
  background-color: #D4AF37;
}
.wrap:before, .wrap:after {
  content: "";
  position: absolute;
  bottom: -3rem;
  width: 70vw;
  height: 5rem;
  background-color: #e6e6e6;
  z-index: 9;
}
.wrap:before {
  left: -10vw;
  transform: rotate(2.5deg);
}
.wrap:after {
  right: -10vw;
  transform: rotate(-2.5deg);
}

.tictoc {
  width: 100%;
  max-width: 25rem;
  margin: 0 auto;
  cursor: pointer;
  transform: translateY(0);
  transition: transform 0.8s 0.2s;
}
.tictoc:hover {
  transform: translateY(150%);
}
.tictoc svg {
  display: block;
  width: 100%;
  height: auto;
  transform-origin: 50% 300%;
  -webkit-animation: ticytocy 0.7s infinite;
          animation: ticytocy 0.7s infinite;
  -webkit-animation-play-state: running;
          animation-play-state: running;
}
.tictoc svg:hover {
  -webkit-animation-play-state: paused;
          animation-play-state: paused;
}

@-webkit-keyframes ticytocy {
  0%, 100% {
    transform: rotate(3deg);
  }
  50% {
    transform: rotate(-3deg);
  }
}

@keyframes ticytocy {
  0%, 100% {
    transform: rotate(3deg);
  }
  50% {
    transform: rotate(-3deg);
  }
}
</style>
